const anexos =
  "['data:image/png;base64,','data:image/png;base64,']";
const advCode = "000480198";

function insereCompromisso(event) {
  event.preventDefault();
  if (verificaCondicoesInteragirSmartContract()) {
    var frm = document.frmCompromisso;
    var frnLoading = $(".formLoading");
    var formSuccess = $(".formSuccess");

    frnLoading.removeClass("hide");
    $("#frmCompromisso").hide();

    setTimeout(function() {
      frnLoading.addClass("hide");
      formSuccess.removeClass("hide");
    }, 2000);

    console.log("buscando documentos para anexo...");
    $("#statusCompromisso").text(
      "Por favor, confirme o envio da transação no Metamask"
    );
    contract.methods
      .insereCompromisso(frm.matricula.value, anexos, advCode)
      .send({ from: conta, gas: 3000000, value: 0 })
      .on("transactionHash", function(hash) {
        $("#statusCompromisso").css("background-color", "yellow");
        $("#statusCompromisso").text(
          "Transação enviada a rede do Ethereum. Aguarde enquanto ela é confirmada. Transaction hash: " +
            hash
        );
      })
      .on("confirmation", function(confirmationNumber, txReceipt) {
        if (confirmationNumber == 7) {
          if (txReceipt) {
            if (txReceipt.status == "0x1") {
              $("#statusCompromisso").css("background-color", "LawnGreen");
              $("#statusCompromisso").html(
                "Registro salvo com sucesso no bloco: " +
                  txReceipt.blockNumber +
                  " - Transaction hash: " +
                  txReceipt.transactionHash +
                  " - Numero confirmações: " +
                  confirmationNumber
              );
            } else {
              $("#statusCompromisso").css("background-color", "Salmon");
              $("#statusCompromisso").html(
                "Aconteceu um erro - Transaction hash: " +
                  txReceipt.transactionHash +
                  " - Status final: " +
                  txReceipt.status
              );
            }
          }
        }
      })
      .on("error", function(err) {
        $("#statusCompromisso").css("background-color", "Salmon");
        $("#statusCompromisso").html("Aconteceu um erro: " + err);
      });
  }
}

function registraInicioVotacao() {
  if (verificaCondicoesInteragirSmartContract()) {
    var frm = document.frmInicioVotacao;
    try {
      let tempo = converteDataParaTimestamp(frm.inicioVotacao.value);
      console.log("registraInicioVotacao - Enviando..." + tempo);
      $("#statusInicioVotacao").text(
        "Por favor, confirme o envio da transação no Metamask"
      );
      contract.methods
        .definirInicioVotacao(tempo)
        .send({ from: conta, gas: 3000000, value: 0 })
        .on("transactionHash", function(hash) {
          $("#statusInicioVotacao").css("background-color", "yellow");
          $("#statusInicioVotacao").text(
            "Transação enviada a rede do Ethereum. Aguarde enquanto ela é confirmada. Transaction hash: " +
              hash
          );
        })
        .on("confirmation", function(confirmationNumber, txReceipt) {
          if (confirmationNumber == 7) {
            if (txReceipt) {
              if (txReceipt.status == "0x1") {
                $("#statusInicioVotacao").css("background-color", "LawnGreen");
                $("#statusInicioVotacao").html(
                  "Registro salvo com sucesso no bloco: " +
                    txReceipt.blockNumber +
                    " - Transaction hash: " +
                    txReceipt.transactionHash +
                    " - Numero confirmações: " +
                    confirmationNumber
                );
              } else {
                $("#statusInicioVotacao").css("background-color", "Salmon");
                $("#statusInicioVotacao").html(
                  "Aconteceu um erro - Transaction hash: " +
                    txReceipt.transactionHash +
                    " - Status final: " +
                    txReceipt.status
                );
              }
            }
          }
        })
        .on("error", function(err) {
          $("#statusInicioVotacao").css("background-color", "Salmon");
          $("#statusInicioVotacao").html("Aconteceu um erro: " + err);
        });
    } catch (err) {
      $("#statusInicioVotacao").css("background-color", "Salmon");
      $("#statusInicioVotacao").html("Aconteceu um erro: " + err);
    }
  }
}
